CREATE TRIGGER vgeneratelevelInsert instead of insert on vgeneratelevel
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            x.b as x,
            y.b as y,
            2 as tid
        from seq8 as x,
             seq8 as y,
             game
        where game.id = 1
          and x.b < game.levelwidth
          and y.b < game.levelheight;

        select
            0 as x,
            0 as y,
            levelwidth - 1 as width,
            levelheight - 1 as height
        from game
        where game.id = 1;




    select room.id as rid
      from room
     order by area desc
     limit 50 offset (select levelrooms
                        from game
                       where game.id = 1);





    delete
      from scratchboard
     where id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where abs (b.y - q.y) < 2
                     and abs (b.x - q.x) < 2
                     and b.tid = 1
                     and q.tid in (1, 20)
                   group by b.id
                   having count(*) = 9);

    update scratchboard
       set tid = 7
     where id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where b.x = q.x and (b.y = q.y - 1 or b.y = q.y + 1)
                     and b.tid in (1, 20, 90)
                     and q.tid in (2, 10, 11)
                     group by b.id
                     having count(*) = 2)
        or id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where b.y = q.y and (b.x = q.x - 1 or b.x = q.x + 1)
                     and b.tid in (1, 20, 90)
                     and q.tid in (2, 10, 11)
                     group by b.id
                     having count(*) = 2)
        or id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where abs(b.y - q.y) < 2
                     and abs(b.x - q.x) < 2
                     and b.tid = 90
                     and q.tid = 90
                     group by b.id
                     having count(*) > 1);

    update scratchboard
       set tid = 7
     where id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where b.x = q.x and (b.y = q.y - 1 or b.y = q.y + 1)
                     and b.tid = 90
                     and q.tid not in (1, 20)
                     group by b.id
                     having count(*) <> 0)
       and id in (select b.id
                    from scratchboard as b,
                         scratchboard as q
                   where b.y = q.y and (b.x = q.x - 1 or b.x = q.x + 1)
                     and b.tid = 90
                     and q.tid not in (1, 20)
                     group by b.id
                     having count(*) <> 0);

    delete
      from scratchboard
     where (   x = 0
            or x = (select game.levelwidth - 1
                      from game
                     where game.id = 1)
            or y = 0
            or y = (select game.levelheight - 1
                      from game
                     where game.id = 1) );

    delete
      from board
     where z = new.z;

    insert or replace into board
        (x, y, z, tid)
        select
            x, y, new.z as z, tid
        from scratchboard;

    update board
       set tid = 5
     where id = (select b.id
                   from board as b,
                        board as q
                  where q.tid in (2, 12, 13, 14, 15, 16, 17, 18, 19)
                    and b.tid = 2
                    and b.z = new.z
                    and q.z = new.z + 1
                    and q.x = b.x
                    and q.y = b.y
                  order by random ()
                  limit 1);

    update board
       set tid = 4
     where id = (select b.id
                   from board as b,
                        board as q
                  where q.tid = 5
                    and b.z = new.z + 1
                    and q.z = new.z
                    and q.x = b.x
                    and q.y = b.y
                  limit 1);

    delete
      from scratchboard;

    delete
      from room;
end;
CREATE TRIGGER vroomfillInsert instead of insert on vroomfill
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x as x,
            scratchboard.y as y,
            1 as tid
        from room, scratchboard
        where room.id = new.rid
          and scratchboard.x >= room.x and scratchboard.x <= room.x + room.width
          and scratchboard.y >= room.y and scratchboard.y <= room.y + room.height;

    delete
      from room
     where room.id = new.rid;
end;
CREATE TRIGGER vaddclutterInsert instead of insert on vaddclutter
for each row begin
    update scratchboard
       set tid = 50
     where id in (select id
                    from scratchboard
                   where tid = 10
                   order by random()
                   limit 30 );

    update scratchboard
       set tid = 51
     where id in (select id
                    from scratchboard
                   where tid = 11
                   order by random()
                   limit 30 );
end;
CREATE TRIGGER vroomconnectionInsert instead of insert on vroomconnection
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x,
            scratchboard.y,
            case when tid = 20 then 90 else 6 end as tid
        from scratchboard, room as r1, room as r2
        where r1.id = new.rid1
          and r2.id = new.rid2
          and (    (   (   ( scratchboard.x >= r1.cx and scratchboard.x <= r2.cx )
                        or ( scratchboard.x <= r1.cx and scratchboard.x >= r2.cx ) )
                    and scratchboard.y = r1.cy )
               or  (   (   ( scratchboard.y >= r1.cy and scratchboard.y <= r2.cy )
                        or ( scratchboard.y <= r1.cy and scratchboard.y >= r2.cy ) )
                    and scratchboard.x = r2.cx ) );
end;
CREATE TRIGGER vroomwallInsert instead of insert on vroomwall
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x as x,
            scratchboard.y as y,
            coalesce(new.tid, 20) as tid
        from room, scratchboard
        where room.id = new.rid
          and (
                  (    scratchboard.x = room.x - 1
                   and scratchboard.y >= room.y - 1 and scratchboard.y <= room.y + room.height + 1)
               or (    scratchboard.x = room.x + room.width + 1
                   and scratchboard.y >= room.y - 1 and scratchboard.y <= room.y + room.height + 1)
               or (    scratchboard.y = room.y - 1
                   and scratchboard.x >= room.x - 1 and scratchboard.x <= room.x + room.width + 1)
               or (    scratchboard.y = room.y + room.height + 1
                   and scratchboard.x >= room.x - 1 and scratchboard.x <= room.x + room.width + 1)
              );
end;
CREATE TRIGGER vroompadInsert instead of insert on vroompad
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x as x,
            scratchboard.y as y,
            case when scratchboard.x = room.x
                   or scratchboard.x = room.x + room.width then coalesce(new.tidv, 1)
                                                           else coalesce(new.tidh, 1)
            end as tid
        from room, scratchboard
        where room.id = new.rid
          and room.height > 2
          and room.width > 2
          and (
                  (    scratchboard.x = room.x
                   and scratchboard.y >= room.y and scratchboard.y <= room.y + room.height)
               or (    scratchboard.x = room.x + room.width
                   and scratchboard.y >= room.y and scratchboard.y <= room.y + room.height)
               or (    scratchboard.y = room.y
                   and scratchboard.x >= room.x and scratchboard.x <= room.x + room.width)
               or (    scratchboard.y = room.y + room.height
                   and scratchboard.x >= room.x and scratchboard.x <= room.x + room.width)
              );

    update room
       set x      = x + 1,
           y      = y + 1,
           width  = width - 2,
           height = height - 2
     where id = new.rid
       and room.height > 2
       and room.width > 2;
end;
CREATE TRIGGER vroomsplitInsert instead of insert on vroomsplit
for each row begin
        select
            room.id as rid,
            coalesce(abs(random()) % (room.width - game.levelsplitwidth), 0) + 7 as offset
        from room, game
        where game.id
          and room.id = new.rid
          and room.width > room.height;

        select
            room.id as rid,
            coalesce(abs(random()) % (room.height - game.levelsplitheight), 0) + 3 as offset
        from room, game
        where game.id = 1
          and room.id = new.rid;
end;
CREATE TRIGGER vroomsplithInsert instead of insert on vroomsplith
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x as x,
            scratchboard.y as y,
            1 as tid
        from room, scratchboard
        where room.id = new.rid
          and scratchboard.y >= room.y and scratchboard.y <= (room.y + room.height)
          and scratchboard.x = room.x + new.offset;

        select
            room.x + new.offset + 1 as x,
            room.y as y,
            room.width - new.offset - 1 as width,
            room.height as height,
            new.rid as rid
        from room
        where room.id = new.rid;

    update room
       set width = new.offset - 1
     where id = new.rid;
end;
CREATE TRIGGER vroomsplitvInsert instead of insert on vroomsplitv
for each row begin
    insert or replace into scratchboard
        (x, y, tid)
        select
            scratchboard.x as x,
            scratchboard.y as y,
            1 as tid
        from room, scratchboard
        where room.id = new.rid
          and scratchboard.y = room.y + new.offset
          and scratchboard.x >= room.x and scratchboard.x <= (room.x + room.width);

        select
            room.x as x,
            room.y + new.offset + 1 as y,
            room.width as width,
            room.height - new.offset - 1 as height,
            new.rid as rid
        from room
        where room.id = new.rid;

    update room
       set height = new.offset - 1
     where id = new.rid;
end;
CREATE TRIGGER roomInsert after insert on room
for each row begin
    update room
       set area = width * height,
           split =    (    width > (select levelsplitwidth
                                      from game
                                     where game.id = 1) 
                        or height > (select levelsplitheight
                                       from game
                                      where game.id = 1 ) )
                   and width * height > (select levelsplitarea
                                           from game
                                          where game.id = 1),
           cx = x + 1 + case when width - 3 > 0 then coalesce(abs(random()) % (width-3),0) else 0 end,
           cy = y + 1 + case when height - 3 > 0 then coalesce(abs(random()) % (height-3),0) else 0 end
     where id = new.id;

    insert or ignore into roomconnection
        (rid1, rid2)
        select
            new.id as rid1,
            rid as rid2
        from room
        where room.id = new.id
          and rid is not null;
end;
CREATE TRIGGER roomUpdate after update on room
for each row begin
    update room
       set area = width * height,
           split =    (    width > (select levelsplitwidth
                                      from game
                                     where game.id = 1) 
                        or height > (select levelsplitheight
                                       from game
                                      where game.id = 1 ) )
                   and width * height > (select levelsplitarea
                                           from game
                                          where game.id = 1),
           cx = x + 1 + case when width - 3 > 0 then coalesce(abs(random()) % (width-3),0) else 0 end,
           cy = y + 1 + case when height - 3 > 0 then coalesce(abs(random()) % (height-3),0) else 0 end
     where id = new.id;
end;
CREATE TRIGGER roomDelete before delete on room
for each row begin
    insert or ignore into roomconnection
        (rid1, rid2)
        select
            rc1.rid2 as rid1,
            rc2.rid2 as rid2
        from roomconnection as rc1,
             roomconnection as rc2
        where rc1.rid1 = old.id
          and rc2.rid1 = old.id
          and rc1.rid2 <> rc2.rid2;

    delete from roomconnection where rid1 = old.id or rid2 = old.id;
end;
CREATE TRIGGER roomconnectionInsert after insert on roomconnection
for each row begin
    insert or ignore into roomconnection
        (rid1, rid2)
        values
        (new.rid2, new.rid1);
end;
CREATE INDEX shadowXY on shadow(x, y);
CREATE INDEX shadowSXY on shadow(sx, sy);
CREATE VIEW vshadow as
select distinct
    q.id as id,
    q.x as x,
    q.y as y,
    q.z as z
from vboard as b,
     shadow as s,
     board as p,
     board as q,
     game as g
where g.id = 1
  and p.cid = g.pov
  and b.opaque
  and s.x = b.x - p.x and s.y = b.y - p.y and s.z = b.z - p.z
  and q.x = s.sx + p.x and q.y = s.sy + p.y and q.z = s.sz + p.z;
CREATE VIEW vvisual as
select
    b.id as id,
    b.x as x,
    b.y as y,
    b.z as z,
    coalesce(b.tile, '#') as tile
from visibility as v,
     game as g,
     board as p,
     vboard as b
left join vshadow as s on s.id = b.id
where g.id = 1
  and p.cid = g.pov
  and v.x + p.x = b.x
  and v.y + p.y = b.y
  and v.z + p.z = b.z
  and s.id is null;
CREATE VIEW vgearslotusage as
select
    gear.id as gid,
    geartype2slottype.stid as stid,
    1 as slots
from gear,
     geartype2slottype
where gear.gtid = geartype2slottype.gtid;
CREATE VIEW vcharactermetatypeslot as
select
    c.id as cid,
    m2s.stid as stid,
    m2s.slots as slots
from metatype2slot as m2s,
     character as c
where c.mid = m2s.mid;
CREATE VIEW vcharactergearslot as
select
    c.cid as cid,
    g2s.stid as stid,
    sum(g2s.slots) as slots
from gear2slot as g2s,
     citem as c,
     item as i
where c.iid = i.id
  and i.gid = g2s.gid
group by c.cid, g2s.stid;
CREATE VIEW vgearslot as
select
    g.id as gid,
    g2s.stid as stid
from gear as g,
     geartype2slottype as g2s
where g.gtid = g2s.gtid;
CREATE VIEW vcharacterslot as
select
    c.id as cid,
    s.id as stid,
    coalesce(ms.slots, 0) + coalesce(gs.slots, 0) as slots
from character as c,
     slottype as s
left join vcharactermetatypeslot as ms on c.id = ms.cid and s.id = ms.stid
left join vcharactergearslot as gs on c.id = gs.cid and s.id = gs.stid
group by c.id, s.id;
CREATE VIEW vitem as
select
    item.id as id,
    corporation.id as maid,
    gear.id as gid,
    geartype2slottype.stid as stid,
    corporation.name || ' ' || gear.name as name
from item, corporation, gear, geartype2slottype
where item.maid = corporation.id
  and item.gid = gear.id
  and gear.gtid = geartype2slottype.gtid;
CREATE VIEW vcharacteritem as
select
    citem.cid as cid,
    vitem.id as iid,
    vitem.maid as maid,
    vitem.gid as gid,
    vitem.stid as stid,
    vitem.name as name
from citem, vitem
where vitem.id = citem.iid;
CREATE VIEW vcharacteritemislot as
select
    (select count(0)
      from vcharacteritem as i2
     where i2.cid = i1.cid
       and i2.iid <= i1.iid) as islot,
    i1.cid as cid,
    i1.iid as iid,
    i1.maid as maid,
    i1.gid as gid,
    i1.stid as stid,
    i1.name as name
from vcharacteritem as i1;
CREATE TRIGGER vcharacteritemInsert instead of insert on vcharacteritem
for each row begin
         coalesce(new.maid, (select cnid from character where id = new.cid)),
         new.cid);

end;
CREATE TRIGGER itemInsert after insert on item
for each row begin
    update item
       set maid = (select corporation.id
                     from corporation
                    order by random()
                    limit 1)
     where id = new.id
       and new.maid is null;
end;
CREATE VIEW vkeymap as
select
    group_concat(keymap.key, ', '),
    command.description
from keymap,
     command
where keymap.cmid = command.id
group by command.id, command.description
order by command.id;
CREATE VIEW vuseobject as
select
    null as cid,
    null as tid;
CREATE TRIGGER vuseobjectInsert instead of insert on vuseobject
for each row begin
        select
            case when board.tid = 90 then 'You open the door.'
                 when board.tid = 91 then 'You close the door.'
            end as message
        from board, game
        where game.id = 1
          and new.cid = game.pov
          and board.id = new.tid
          and board.tid in (90, 91);

    update board
       set tid = case when tid = 90 then 91
                      when tid = 91 then 90 end
     where id = new.tid
       and tid in (90, 91);
end;
CREATE VIEW vteleport as
select
    null as cid,
    null as oid,
    null as tid;
CREATE VIEW vmove as
select
    null as x,
    null as y,
    null as z;
CREATE VIEW vdirection as
select
    null as cmid,
    null as x,
    null as y;
CREATE TRIGGER vteleportInsert instead of insert on vteleport
for each row begin
    update board
       set cid = new.cid
     where id = new.tid
       and not (select opaque from vboard where id = new.tid);

    update board
       set cid = null
     where id = new.oid
       and (select cid from board where id = new.tid) = new.cid;

        select
            new.cid as cid,
            new.tid as tid
        from board
        where id = new.oid
          and cid = new.cid;
end;
CREATE VIEW vlevelchange as
select null as z;
CREATE TRIGGER vlevelchangeInsert instead of insert on vlevelchange
for each row begin
    update game set refresh = 1;

end;
CREATE TRIGGER vmoveInsert instead of insert on vmove
for each row begin
        select
            b1.cid as cid,
            b1.id as oid,
            b2.id as tid
        from board as b1,
             board as b2,
             game as g
        where g.id = 1
          and b1.cid = g.pov
          and b2.x = b1.x + coalesce(new.x, 0)
          and b2.y = b1.y + coalesce(new.y, 0)
          and b2.z = b1.z + coalesce(new.z, 0);

        select
            1 as z
        where coalesce(new.z,0) <> 0;
end;
CREATE TRIGGER vdirectionInsert instead of insert on vdirection
for each row begin
        select
            b1.cid as cid,
            b2.id as tid
        from board as b1,
             board as b2,
             game as g
        where g.id = 1
          and new.cmid = 30
          and b1.cid = g.pov
          and b2.x = b1.x + coalesce(new.x, 0)
          and b2.y = b1.y + coalesce(new.y, 0)
          and b2.z = b1.z;
end;
CREATE VIEW vinvokecommand as
select
    null as cmid,
    null as moid;
CREATE VIEW vsimulate as
select
    null as turn;
CREATE TRIGGER vinvokecommandInsertRoamSearch instead of insert on vinvokecommand
for each row when new.cmid = 22 and new.moid = 0 begin
    update game
       set turn = turn + 1,
           msid = case when (select max(id) from message) > msid then msid + 1 else msid end;

        select
            p.z - 1
        from board as p,
             game as g
        where g.id = 1
          and p.cid = g.pov
          and not exists (select tid
                            from board as s
                           where s.tid = 4
                             and s.z = p.z);
end;
CREATE TRIGGER vinvokecommandInsertRoam instead of insert on vinvokecommand
for each row when new.cmid is not null and new.cmid <> 22 and new.moid = 0 begin
    update game
       set refresh = (new.cmid = 1),
           turn = case when new.cmid in (1, 30, 31, 32) then turn else turn + 1 end,
           msid = case when (select max(id) from message) > msid then msid + 1 else msid end,
           cmid = case when new.cmid in (30, 31, 32) then new.cmid else null end,
           moid = case when new.cmid in (30, 31, 32) then new.cmid - 29 else 0 end;

    update character
       set commlinkactive = not commlinkactive
     where new.cmid = 23
       and character.id = (select pov from game where id = 1);

        select x, y from command2direction where cmid = new.cmid;

        select new.cmid - 6
          from board, game
         where new.cmid in (5, 7)
           and game.id = 1
           and board.cid = game.pov
           and board.tid = case when new.cmid = 7 then 5 else 4 end;

end;
CREATE TRIGGER vinvokecommandInsertDirection instead of insert on vinvokecommand
for each row when new.cmid is not null and new.moid = 1 begin
        select game.cmid, x, y
          from command2direction, game
         where game.id = 1
           and command2direction.cmid = new.cmid;

    update game
       set moid = 0,
           cmid = null,
           turn = turn + 1;
end;
CREATE TRIGGER vinvokecommanInsertInventory instead of insert on vinvokecommand
for each row when new.cmid is not null and new.moid = 2 begin
    update game
       set moid = 0,
           cmid = null,
           turn = turn + 1;
end;
CREATE TRIGGER vinvokecommandInsertTarget instead of insert on vinvokecommand
for each row when new.cmid is not null and new.moid = 3 begin
    update game
       set moid = 0,
           cmid = null,
           turn = turn + 1;
end;
CREATE VIEW vkeypress as
select
    null as key;
CREATE TRIGGER vkeypressInsert instead of insert on vkeypress
for each row when new.key is not null begin
        select
            keymap.cmid as cmid,
            game.moid as moid
        from keymap, game
        where key = new.key
          and keymap.moid = game.moid
          and game.id = 1;
end;
CREATE VIEW voutputansiwant as
select
    x.b as x,
    y.b as y,
    case when v.tile is not null then 37
         else 34
    end as colour,
    case when v.tile is not null then v.tile
         when b.tile is not null and b.onmap and c.commlinkactive then b.tile
         else ' '
    end as tile
from seq8 as x,
     seq8 as y,
     game as g,
     vboard as b,
     board as p,
     vcharacter as c
left join vvisual as v on v.id = b.id
where g.id = 1
  and c.id = g.pov
  and x.b > 0 and x.b < (g.columns + case when g.moid = 2 then -50 else 0 end)
  and y.b > 3 and y.b < (g.lines - 1)
  and b.x = (x.b-g.offsetx) and b.y = (y.b-g.offsety) and b.z = p.z
  and p.cid = g.pov
union all
select
  g.columns - 49 as x,
  y.b + 4 as y,
  37 as colour,
  k.key || ') ' || i.name as tile
from game as g, seq8 as y, vcharacteritemislot as i, keymap as k
where g.id = 1
  and g.moid = 2
  and i.cid = g.pov
  and i.islot = y.b
  and k.moid = g.moid
  and k.cmid = 39 + i.islot
  and y.b < (g.lines - 4) and y.b <= (select count(*)
                                        from vcharacteritem
                                       where cid = g.pov)
union all
select
  0 as x,
  game.lines - 1 as y,
  37 as colour,
     'Level: ' || board.z
  || ' Karma: ' || vcharacter.karmatotal || ' (' || vcharacter.karma || ') '
  || vcharacter.name
  || ' (' || profile.name || ')'
  || case when game.moid <> 0 then ' :: ' || gamemode.description else '' end
  || '; Next: '
    || case when vnext.aid is not null then (select name from attribute where vnext.aid = id)
            when vnext.sid is not null then (select name from skill where vnext.sid = id) end
    || ' +1 (' || vnext.karma || ')'
  || X'1B' || '[K'
  as tile
from board, game, vcharacter, profile, gamemode, vnext
where game.id = 1
  and board.cid = game.pov
  and vcharacter.id = game.pov
  and vcharacter.pid = profile.id
  and gamemode.id = game.moid
  and vnext.cid = vcharacter.id
union all
select
  0 as x,
  0 as y,
  37 as colour,
  case when refresh = 1 then X'1B' || '[2J' else '' end ||
  coalesce(group_concat(message, ' '),'') ||
  X'1B' || '[K' as tile
from game
left outer join message on message.id > game.msid
where game.id = 1;
CREATE VIEW voutputansi as
select
    X'1B' || '[' || w.colour || 'm' ||
    X'1B' || '[' || w.y || 'H' ||
    group_concat(X'1B' || '[' || w.x || 'G' || w.tile, '') as diff
from voutputansiwant as w
group by w.y, w.colour;
COMMIT;
